import DataContext from "../data/DataContext";

const ReportComponent = () => {
    const {income, expense} = useContext(DataContext)
    return (
        <div>
            <h4>ยอดคงเหลือ (บาท)</h4>
            <h1>{income - expense}</h1>
            
        </div>
    )
}

export default ReportComponent;
